import React, {Component} from "react";
import Parser from 'html-react-parser';

class Menu extends Component
{
    constructor(props) {
        super(props);
    }

    render()
    {
        let classMenu = this.props.classMenu
        let idMenu = this.props.idMenu

        return (
                 <nav className={`${classMenu} navigation`} id={idMenu}>
                            <a className="navigation__link" href="#1">ARTWORK</a>
                            <a className="navigation__link" href="#2">ABOUT</a>
                            <a className="navigation__link" href="#3">CONNECT</a>
                  </nav>
        )
    }
}

export default Menu
